DROP DATABASE IF EXISTS assignment;

CREATE DATABASE assignment;

USE assignment;



# ========================
# DDL

CREATE TABLE MOVIE
(
    id            INT AUTO_INCREMENT,
    name          VARCHAR(255)  NOT NULL,
    description   VARCHAR(512)  NOT NULL,
    year          INT           NOT NULL,
    genres        JSON          NOT NULL,
    actors        JSON          NOT NULL,
    directors     JSON          NOT NULL,
    image_url     VARCHAR(2083) NOT NULL,
    thumbnail_url VARCHAR(2083) NOT NULL,
    rating        DOUBLE        NOT NULL,
    duration      VARCHAR(16)   NOT NULL,
    CONSTRAINT MOVIE_pk PRIMARY KEY (id)
);

CREATE TABLE USER
(
    id         INT AUTO_INCREMENT,
    name       VARCHAR(255)  NOT NULL,
    sex        VARCHAR(6)    NOT NULL,
    avatar_url VARCHAR(2083) NOT NULL,
    CONSTRAINT USER_pk PRIMARY KEY (id)
);

CREATE TABLE COMMENT
(
    id        INT AUTO_INCREMENT,
    content   VARCHAR(512) NOT NULL,
    timestamp TIMESTAMP    NOT NULL,
    user_id   INT          NOT NULL,
    movie_id  INT          NOT NULL,
    CONSTRAINT COMMENT_USER_id_fk FOREIGN KEY (user_id) REFERENCES USER (id),
    CONSTRAINT COMMENT_MOVIE_id_fk FOREIGN KEY (movie_id) REFERENCES MOVIE (id),
    CONSTRAINT COMMENT_pk PRIMARY KEY (id)
);



