INSERT INTO assignment.COMMENT (id, content, timestamp, user_id, movie_id)
VALUES  (1, 'Sustineo a despecto catena autus arto cursus veritas ulciscor inflammatio. Complectus vergo beatae ventosus acervus vobis talus cuius termes commodi.', '2023-12-08 10:29:56', 879, 237),
